import React from "react";
import { Link } from "react-router-dom";
import PropTypes from "prop-types";
import { withStyles } from "@material-ui/core/styles";
import "./Navbar.css";
import DSLR from "../Container/DSLR";
import MenuBar from "./MenuBar";
const styles = {
  root: {
    flexGrow: 1
  },
  button: {
    color: "#d6d7da",
    fontSize: 18,
    alignItems: "center",
    height: 50,
    fontFamily: "'Montserrat', sans-serif",
    cursor: "pointer"
  },
  tit: {
    textDecoration: "none",
    cursor: "pointer"
  }
};
function getUsername() {
  var mail = this.props.user.email;
  var username = mail.substring(0, mail.indexOf("@"));
  localStorage.setItem("username", username);

  return username;
}
function NavbarPage(props) {
  const { classes } = props;

  return (
    <nav id="menu" className="menu " className="appbar">
      <Link to="/" className={classes.tit}>
        {" "}
        <button className="but-title">
          {" "}
          <h3 className="title">Kroz objektiv</h3>
        </button>{" "}
      </Link>
      <div className="dropdown">
        <button className="dropbtn">Tipovi fotoaparata</button>
        <div className="dropdown-content">
          <a href="/dslr">DSLR</a>
          <a href="#">Mirrorless</a>
          <a href="#">Kompaktni</a>
          <a href="#">Analogni</a>
          <a href="#">Canon</a>
          <a href="#">Nikon</a>
          <a href="#">Canon</a>
          <a href="#">Sony</a>
          <a href="#">Pentax</a>
        </div>
      </div>
      <div className="dropdown">
        <button className="dropbtn">Tips'n'tricks</button>
        <div className="dropdown-content">
          <a href="#">Sve</a>
          <a href="#">Kamera trikovi</a>
          <a href="#">Video trikovi</a>
          <a href="#">Editiranje</a>
        </div>
      </div>
      <div className="dropdown">
        <button className="dropbtn">Oprema</button>
        <div className="dropdown-content">
          <a href="#">Sve</a>
          <a href="#">Objektivi</a>
          <a href="#">Bljeskalice</a>
          <a href="#">Filteri</a>
        </div>
      </div>
      <div className="dropdown">
        <button className="dropbtn">{getUsername()}</button>
        <div className="dropdown-content">
          <a href="#">Sve</a>
          <a href="#">Objektivi</a>
          <a href="#">Bljeskalice</a>
          <a href="#">Filteri</a>
        </div>
      </div>
    </nav>
  );
}

NavbarPage.propTypes = {
  classes: PropTypes.object.isRequired
};

export default withStyles(styles)(NavbarPage);
